import React from 'react';
import '../css/FontAwesome.css';
import '../css/Skills.css'

function Skills() {
  return(
    <div className="skills-icons">
      <label><i className="fab fa-git-alt outer-shadow git"></i></label>
      <i className="fab fa-linux outer-shadow linux"></i>
      <i className="fab fa-html5 outer-shadow html"></i>
      <i className="fab fa-css3-alt outer-shadow css"></i>
      <i className="fab fa-js outer-shadow js"></i>
      <i className="fab fa-react outer-shadow react"></i>
      <i className="fab fa-node-js outer-shadow node"></i>
      <i className="fas fa-database outer-shadow mysql"></i>
      <i className="fas fa-database outer-shadow mongodb"></i>
    </div>
  );
}

export default Skills;
